import React from "react";

const PANDA = "data:image/png;base64,";
const PANDA2 = "data:image/png;base64,";
const DUMPLING = "data:image/png;base64,";
const BACKGROUND = "data:image/png;base64,";

const PANDA_OFFSET_INCR = 12;
const FPS = 1000 / 24;
const BG_SPEED = 4;

class Dumpling {
  constructor(canvas, image) {
    this.canvas = canvas;
    this.image = image;

    this.x = canvas.width;
    this.y = canvas.height - image.height - 6;
  }

  draw(ctx) {
    ctx.drawImage(this.image, this.x, this.y);
    this.x -= BG_SPEED;
  }

  isDone() {
    return this.x < -this.image.width;
  }
}

export default class PandaForce extends React.Component {
  constructor() {
    super();

    this.draw = this.draw.bind(this);
    this.drawBackground = this.drawBackground.bind(this);
    this.drawPanda = this.drawPanda.bind(this);
    this.drawInfo = this.drawInfo.bind(this);
    this.drawDumplings = this.drawDumplings.bind(this);
    this.drawScore = this.drawScore.bind(this);

    this.handleCanvasClick = this.handleCanvasClick.bind(this);
    this.generateDumpling = this.generateDumpling.bind(this);

    this.images = {
      panda: new Image(),
      panda2: new Image(),
      background: new Image(),
      dumpling: new Image()
    };

    this.images.background.src = BACKGROUND;
    this.images.panda.src = PANDA;
    this.images.panda2.src = PANDA2;
    this.images.dumpling.src = DUMPLING;

    this.pandaPictureState = 0;
    this.playing = false;
    this.looser = false;
    this.isJumping = false;
    this.dumplings = [];

    this.bgOffset = 0;
    this.pandaOffset = 0;
    this.pandaOffsetIncr = -PANDA_OFFSET_INCR;

    this.score = 0;
  }

  componentDidMount() {
    if (this.refs.canvas) {
      this.draw();
    }
  }

  handleCanvasClick() {
    if (!this.playing && !this.looser) {
      this.playing = true;
      this.generateDumpling();

      this.draw();
    }

    if (this.isJumping) {
      this.pandaOffsetIncr = -PANDA_OFFSET_INCR;
    } else {
      this.isJumping = true;
    }
  }

  generateDumpling() {
    this.dumplings.push(new Dumpling(this.refs.canvas, this.images.dumpling));
    if (this.playing) {
      setTimeout(this.generateDumpling, Math.random() * 1000 * 3);
    }
  }

  drawBackground(ctx) {
    ctx.drawImage(this.images.background, this.bgOffset, 0);
    ctx.drawImage(this.images.background, this.images.background.width + this.bgOffset, 0);

    if (this.playing) {
      this.bgOffset = (this.bgOffset - BG_SPEED) % this.images.background.width;
    }
  }

  drawPanda(ctx) {
    const {canvas} = this.refs;
    if (this.pandaPictureState < 4) {
      ctx.drawImage(this.images.panda, 0, canvas.height - this.images.panda.height - 6 + this.pandaOffset);
    } else {
      ctx.drawImage(this.images.panda2, 0, canvas.height - this.images.panda.height - 6 + this.pandaOffset);
    }

    if (this.playing) {
      this.pandaPictureState = (this.pandaPictureState + 1) % 8;
    }

    if (this.isJumping) {
      this.pandaOffset += this.pandaOffsetIncr;
      if (this.pandaOffset < -0.6 * canvas.height + this.images.panda.height - 24) {
        this.pandaOffsetIncr = PANDA_OFFSET_INCR;
      }

      if (this.pandaOffset > 0) {
        this.pandaOffset = 0;
        this.pandaOffsetIncr = -PANDA_OFFSET_INCR;
        this.isJumping = false;
      }
    }
  }

  drawDumplings(ctx) {
    this.dumplings = this.dumplings.map(d => {
      if (-this.pandaOffset < this.images.dumpling.height && d.x > 0 && d.x < this.images.panda.width) {
        this.playing = false;
        this.looser = true;
        if (!window.localStorage.PandaForceScore || window.localStorage.PandaForceScore && window.localStorage.PandaForceScore < this.score) {
          window.localStorage.setItem("PandaForceScore", this.score + 1);
        }
      }

      if (d.isDone()) {
        return null;
      } else {
        d.draw(ctx);
        return d;
      }
    }).filter(d => d ? true : false);
  }

  drawInfo(ctx) {
    if (this.looser) {
      ctx.fillStyle = "rgba(225,225,225,0.75)";
      ctx.fillRect(12, 12, this.refs.canvas.width - 24, this.refs.canvas.height - 24);

      ctx.fillStyle = "#ff0000";
      ctx.font = "36px SwissquoteCT";
      ctx.fillText("You FAILED!", 48, 48);
      ctx.font = "20px SwissquoteCT";
      ctx.fillText("Panda is dead! Shame on you!", 24, 12 + 12 + 48 + 24);
      ctx.fillText(`Your score: ${this.score}`, 24, 12 + 12 + 48 + 2 * 24);
      ctx.fillText(`Your best score: ${window.localStorage.PandaForceScore || this.score}`, 24, 12 + 12 + 48 + 3 * 24);
    } else {
      ctx.fillStyle = "rgba(225,225,225,0.75)";
      ctx.fillRect(12, 12, this.refs.canvas.width - 24, 48);
      ctx.fillRect(12, 12 + 12 + 48, this.refs.canvas.width - 24, 48);

      ctx.fillStyle = "#60ff60";
      ctx.font = "36px SwissquoteCT";
      ctx.fillText("PandaForce!", 48, 48);
      ctx.fillStyle = "#000000";
      ctx.font = "14px SwissquoteCT";
      ctx.fillText("Click on canvas to make your panda jump!", 24, 12 + 12 + 48 + 24);
    }
  }

  drawScore(ctx) {
    ctx.font = "16px SwissquoteCT";
    ctx.fillStyle = "#ffffff";
    ctx.fillText(`Score: ${this.score}`, 0, 16);
  }

  draw() {
    const {canvas} = this.refs;

    const ctx = canvas.getContext("2d");
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    this.drawBackground(ctx);
    this.drawPanda(ctx);

    if (this.playing) {
      this.drawDumplings(ctx);
      this.drawScore(ctx);

      this.score += 1;
      setTimeout(this.draw, FPS);
    } else {
      this.drawInfo(ctx);
    }
  }

  render() {
    return <canvas style={{width: "100%"}} height="192" ref="canvas" onMouseDown={this.handleCanvasClick}/>;
  }
}
